import './App.css';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

import { Home } from './views/Home';
import { Listar } from './views/Cliente/Listar';
import { ListarServ } from './views';
import { ListarPed } from './views';

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route  exact path="/" component={Home}/>
          <Route path="/listar-cliente" component={ Listar }/>
          <Route path="/listar-servico" component={ ListarServ }/>
          <Route path="/listar-pedido" component={ ListarPed }/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
